export interface PDFPageFill {
    x: number;
    y: number;
    clr: number;
    w: number;
    h: number;
    oc: string;
}
export interface PDFPageBox {
    t: {
        name: string;
        typeInfo: {};
    };
    id?: {
        id: string;
        en: number;
    };
    style: number;
    ti: number;
    am: number;
    x: number;
    y: number;
    w: number;
    h: number;
    checked?: boolean;
}
export interface PDFPageBoxSet {
    boxes: PDFPageBox[];
}
export interface PDFPageText {
    x: number;
    y: number;
    w: string;
    sw: number;
    text: string;
    clr: number;
    oc: string;
    a: string;
    r: {
        t: string;
        s: string;
        ts: number[];
    }[];
}
export interface PDFPageField {
    style: number;
    t: {
        name: string;
    };
    id: {
        id: string;
        en: number;
    };
    ti: number;
    am: number;
    tu: string;
    x: number;
    y: number;
    w: number;
    h: number;
    v?: string;
    mv?: string;
}
export interface PDFPage {
    height: number;
    hLines: string[];
    vLines: string[];
    fills: PDFPageFill[];
    fields: PDFPageField[];
    texts: PDFPageText[];
    boxSets: PDFPageBoxSet[];
}
export interface JsonPdf {
    transcoder: string;
    agency: string;
    width: string;
    id: {
        agencyId: string;
        name: string;
        mc: boolean;
        max: number;
        parent: number;
    };
    pages: PDFPage[];
    fields: PDFPageField[];
    plainText: string;
}
